    set new.id_generica=left(new.generica,1);
    set new.id_especifica=concat(left(new.tipo_transaccion,1),left(new.generica,1),trim(left(new.subgenerica,2)),trim(left(new.subgenerica_det,2)),trim(left(new.especifica,2)),trim(left(new.especifica_det,2)));
